/** @format */
import React, { Fragment, useState } from "react";
import {
  TextField,
  Switch,
  FormControlLabel,
  Box,
  Grid,
  Button,
  Typography,
} from "@mui/material";
import SaveIcon from "@mui/icons-material/Save";
import { useToggle } from "../../context/useToggle";
const CreateTask = () => {
  const [bill, setBill] = useToggle(false);
  const [isPrivate, setIsPrivate] = useToggle(true);
  const [taskData, setTaskData] = useState({
    matter_no: 0,
    matter_contact: "",
    matter: "",
    billable: true,
    is_private: true,
    task: "",
    due: "",
    assign_to: "",
    detail: "",
  });

  const {
    matter_no,
    matter_contact,
    matter,
    billable,
    is_private,
    task,
    due,
    assign_to,
    detail,
  } = taskData;

  const onChange = (e) =>
    setTaskData({ ...taskData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();

    // login(username, email, password);
  };
  return (
    <Fragment>
      <Box
        component="form"
        Validate
        sx={{
          "& .MuiTextField-root": { m: 1 },
        }}
        onSubmit={(e) => onSubmit(e)}
      >
        <Typography component="h3" variant="h4">
          Create New Matter
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_contact"
              label="matter_contact"
              type="text"
              value={matter_contact}
              onChange={(e) => onChange(e)}
              id="matter_contact"
              autoComplete="matter_contact"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter"
              label="matter"
              type="text"
              value={matter}
              onChange={(e) => onChange(e)}
              id="matter"
              autoComplete="matter"
            />
            <FormControlLabel
              size="large"
              label="Billable"
              labelPlacement="start"
              control={
                <Switch
                  size="large"
                  checked={bill}
                  onChange={() => setBill(bill)}
                />
              }
            />
            <FormControlLabel
              size="large"
              label="Private"
              labelPlacement="start"
              control={
                <Switch
                  size="large"
                  checked={isPrivate}
                  onChange={() => setIsPrivate(bill)}
                />
              }
            />

            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
            <TextField
              size="small"
              margin="normal"
              variant="outlined"
              name="matter_no"
              label="matter_no"
              type="text"
              value={matter_no}
              onChange={(e) => onChange(e)}
              id="matter_no"
              autoComplete="matter_no"
            />
          </Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default CreateTask;
